router.delete('/delete-participation/:id', async (req, res) => {
  const participationId = req.params.id;

  try {
    const participation = await Participation.findByPk(participationId);

    if (!participation) {
      return res.status(404).json({ error: 'Participation not found' });
    }

    await user.destroy();

    res.status(200).json({ message: 'Participation deleted successfully' });
  } catch (error) {
    console.error('Error during participation deletion:', error);
    res.status(500).json({ error: 'Error during participation deletion' });
  }
});

